import React from "react";
import styled from "styled-components";
import ImageBox from "./ImageBox";
import TextBox from "./TextBox";

const Container = styled.div`
  display: flex;
`;

const ContentsBox = ({ children }) => {
  return (
    <Container>
      <ImageBox />
      <TextBox />
    </Container>
  );
};

export default ContentsBox;
